import { BrowserRouter, Route, Router, Routes } from "react-router-dom";
import Footerres from "./componetns/Footerres";
import Home from "./componetns/Home";
import Navbares from "./componetns/Navbares";
import 'bootstrap/dist/css/bootstrap.min.css';
import Addrestaurant from "./componetns/addRestaurants/Addrestaurant";
import AddresSignup from "./componetns/addRestaurants/AddresSignup";
import AddresLogin from "./componetns/addRestaurants/AddresLogin";
import AddresHome from "./componetns/addRestaurants/AddresHome";
import Restuarantdetais from "./componetns/RestuarantDetails/Restuarantdetais";
import UserProfile from "./componetns/UserProfile";




function App() {
  return (

    <div>
      <BrowserRouter>
        <Navbares />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/addres" element={<Addrestaurant />} />
          <Route path="/signup" element={<AddresSignup />} />
          <Route path="/login" element={<AddresLogin />} />
          <Route path="/dashboard" element={<AddresHome/>} />
          <Route path="/details" element={<Restuarantdetais/>} />
          <Route path="/userProfile/:id/" element={<UserProfile/>} />




        </Routes>
        <Footerres />
      </BrowserRouter>

    </div>


  );
}

export default App;
